ag'=>'Tocar y arrastrar','Enable the ability to drag the carousel slides on touch screens.'=>'Active la capacidad de arrastrar las imágenes del carrusel en pantallas táctiles.','Navigation Font size'=>'Tamaño de fuente de navegación','Manually set the font size for navigation link.'=>'Establece manualmente el tamaño de la letra del enlace de navegación.','Navigation Arrow Color'=>'Color de la flechas de navegación','Set a color for the carousel next and previous navigation arrows.'=>'Establece un color para las flechas de navegación anterior y posterior del carrusel.','Dot Navigation Color'=>'Color de navegación por puntos','Set a color for the carousel navigation dots.'=>'Establece un color de los puntos de navegación del carrusel.','Active Dot Navigation Color'=>'Color del punto activo de la navegación','Set a color for the carousel navigation active dot.'=>'Establece un color para el punto activo del carrusel de navegación.','Autoplay'=>'Reproducción automática','When enabled, carousel will start rotating automatically without the visitor needing to click the next and previous arrows.'=>'Cuando está habilitado, el carrusel comenzará a rotar automáticamente sin que el visitante tenga que hacer clic en las flechas anterior ni posterior.','Autoplay Speed'=>'Velocidad de la reproducción automática','Set the speed for the carousel automatic rotation in milliseconds. The higher the number the longer the pause between rotations.'=>'Establece la velocidad de rotación automática del carrusel en milisegundos. Cuanto mayor sea el número, mayor será la pausa entre rotaciones.','Continue Autoplay On Hover'=>'Continuar reproducción automática al pasar el ratón por encima','Choose to contine the carousel rotation even on mouse hover.'=>'Elige contener la rotación del carrusel incluso al pasar el ratón por encima.','Organizer'=>'Organizador',' by '=>' por ','true'=>'verdadero','Price'=>'Precio','Website'=>'Sitio web','Time'=>'Hora','Date'=>'Fecha','Venue'=>'Ubicación','at'=>'en'