cription is the text written within the backend text editor of the single event pages using the classic WordPress editor. This Show Event Description setting is intended for simple text descriptions and is not recommended in most cases. Instead, you should use the Divi Post Content module, which is much more suited for showing content from pages build with Gutenberg or the Divi Builder.'=>'Elige mostrar u ocultar la descripción del evento. La descripción del evento es el texto dentro del editor de texto del escritorio de las páginas de eventos individuales cuando se utiliza el editor clásico de WordPress. Esta opción de «Mostrar descripción de eventos» está diseñada para descripciones de texto simples y no se recomienda en la mayoría de los casos. En su lugar, debe usar el módulo de Divi «Contenido de entrada», que es mucho más adecuado para mostrar contenido de páginas creadas con Gutenberg o Divi Builder.','Choose to show or hide the description of the event.'=>'Elige mostrar u ocultar la descripción del evento.','Show Google Map Link'=>'Mostrar enlace a Google Map','Choose to show or hide the event location Google Map link.'=>'Elige mostrar u ocultar el enlace de Google Maps de la ubicación del evento.','Show Venue Phone'=>'Mostrar teléfono de la localización del evento','Show Venue Website'=>'Mostrar sitio web de la localización del evento','Show Organizer Phone'=>'Mostrar teléfono del organizador','Show Organizer Email'=>'Correo electrónico del organizador','Show Organizer website'=>'Mostrar sitio web del organizador','Show Event Tags'=>'Mostrar etiquetas de evento','Choose to show or hide the event tags.'=>'Elige mostrar u ocultar las etiquetas del evento.','Show Add To Calendar Button'=>'Mostrar botón «Añadir al calendario»','Choose to show or hide the add to calendar button and links.'=>'Elige mostrar u ocultar el botón y los enlaces de «Añadir al calendario».','Show Google Calendar Link'=>'Mostrar enlace a Google Calendar','Choose to show or hide the link f